import theme from '../UI/Theme';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';

import classes from './BottomBanner.module.css';
import ContainedButtonEl from '../UI/ContainedButton';


const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none",
  [theme.breakpoints.down("md")]: {
    width: "80%",
    marginRight: "10%",
    marginLeft: "10%"
  }
})

const Banner = () => {
  return (
    <div className={classes["hero-image"]}>
      <div className={classes["hero-text"]}>
        <h2>Ad eos saepe lucilius, noster postulant.</h2>
        <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum. At nam minimum ponderum.</p>
        <ContainedButtonEl action={"Learn More"} />
      </div>
    </div>
  )
};

export default Banner;
